pragma solidity >=0.4.22 <0.6.0;

import "./VoteApp.sol";
import "../clearing/ClearingFundPool.sol";
import "../Interface/ITradeFundPool.sol";
import "../Token/SharesB.sol";

contract Vote_Clearing is VoteApp{

    /// @notice 当前的清算提议  同时期应该只允许一个清算提议
    ClearingProposal public cur_clearingProposal;

    /// @notice 所有的清算提议
    ClearingProposal[] clearingProposalQueue;

    address public tradeAddress;

    //清退达成最低要求的同意比例
    uint256 public minApproveRatio_1000;

    /// @notice 清算提议
    struct ClearingProposal{
        uint256 index;
        mapping(address => uint256) clearingList;//同意人的列表
        uint256 startTime;//开始的时间
        address proposer;//清算的发起者
        uint256 totalSharesAmount;//同意的总票数
        address payable address_clearingFundPool;
        bool pass; //是否通过
        bool process; //是否已经处理过
        string detail; //说明
    }

    /// @notice 申请提议
    event OnApplyClearingProposal(
        uint256 index,
        address proposaler,
        address payable address_clearingFundPool,
        uint256 startTime
    );

    /// @param who 投票人
    /// @param index 提议的序列号
    /// @param voteResult 投什么票
    /// @param sharesAmount 有多少股
    event OnVoteClearingProposal(
        address who,
        uint256 index,
        uint256 sharesAmount
    );

    /// @param index 提议的序列号 , pass 是否通过
    event OnProcessClearingProposal(
        uint256 index,
        bool pass
    );

    constructor(
        AppManager _appManager,
        address _sharesAddress,
        address _tradeAddress,
        uint256 _minApproveRatio_1000,
        uint256 _votingStartTime,
        uint256 _publicityStartTime,
        uint256 _deposit,
        uint256 _proposalFee
    )
    VoteApp(_appManager,_sharesAddress,_votingStartTime,_publicityStartTime,_deposit,_proposalFee)
    public
    {
        minApproveRatio_1000 = _minApproveRatio_1000;
        tradeAddress = _tradeAddress;
    }

    /// @notice 发起清算提议
    /// @dev 股东都可以发起清算提议
    function applyClearingProposal(string memory _detail) public payable ownShares(){
        //只能允许一个清算提议
        require(cur_clearingProposal.proposer == address(0),"Only one proposal is allowed");
        //发起提议的人需要转给本合约一定的费用奖励处理者
        transferF(msg.sender, address(this), proposalFee + deposit);

        ClearingFundPool _clearingFundPool = new ClearingFundPool(address(this),appManager.getAssetAddress(),sharesAddress);
        sharesB(sharesAddress).addWhiteAddress(address(_clearingFundPool));

        cur_clearingProposal = ClearingProposal({
            index : clearingProposalQueue.length,
            proposer : msg.sender,
            totalSharesAmount : 0,
            startTime : now,
            pass : false,
            process : false,
            address_clearingFundPool : address(_clearingFundPool),
            detail : _detail
        });

        emit OnApplyClearingProposal(
            cur_clearingProposal.index,
            cur_clearingProposal.proposer,
            address(_clearingFundPool),
            cur_clearingProposal.startTime
        );
    }

    /// @notice 参与清算提议
    function voteClearingProposal(uint256 _amount) public ownShares(){
        //需要在投票期间
        require(now <= cur_clearingProposal.startTime + votingPeriodLength,"time out");
        //将投票的股份转移到clearingFundPool合约
        bool r = sharesB(sharesAddress).transferFrom(msg.sender,cur_clearingProposal.address_clearingFundPool,_amount);
        require(r, "transferFrom error");

        cur_clearingProposal.clearingList[msg.sender] += _amount;
        cur_clearingProposal.totalSharesAmount += _amount;

        ClearingFundPool(cur_clearingProposal.address_clearingFundPool).register(msg.sender,_amount);

        emit OnVoteClearingProposal(msg.sender,cur_clearingProposal.index,_amount);
    }

    /// @notice 处理提议
    function processClearingProposal() public {
        //已经过了投票期了
        require(now > cur_clearingProposal.startTime + votingPeriodLength,"it's within the expiry date");
        require(cur_clearingProposal.process == false,"needs proposals have not been addressed");
        uint256 approveRatio_1000 = cur_clearingProposal.totalSharesAmount.mul(1000).div(getTotalSupply());
        if(approveRatio_1000 >= minApproveRatio_1000){
            cur_clearingProposal.pass = true;
            ITradeFundPool(tradeAddress).clearing(cur_clearingProposal.address_clearingFundPool,approveRatio_1000);
            ClearingFundPool(cur_clearingProposal.address_clearingFundPool).setResult(1);
        }
        else{
            cur_clearingProposal.pass = false;
            ClearingFundPool(cur_clearingProposal.address_clearingFundPool).setResult(2);
        }
        //标示已经处理
        cur_clearingProposal.process = true;
        clearingProposalQueue.push(cur_clearingProposal);

        //通知
        emit OnProcessClearingProposal(
            cur_clearingProposal.index,
            cur_clearingProposal.pass
        );

        //当前的清算要置空
        cur_clearingProposal = ClearingProposal({
            index : 0,
            proposer : address(0),
            address_clearingFundPool : address(0),
            totalSharesAmount : 0,
            startTime : 0,
            pass : false,
            process : false,
            detail : ""
        });
    }
}
